import React from 'react';
import { Link } from 'react-scroll';
import Logo from '../assets/logo.svg';
import '../style/navbar.css';
import cl from './classes.module.css'

const Navbar = () => {
  return (
      <div className="navbar">
          <div className="navbar-logo">
              <img src={Logo} alt="sunnyside"/>
          </div>
          <div className="navbar-links">
              <Link className="links-about links" to="about" smooth={true}>About</Link>
              <Link className="links-services links">Services</Link>
              <Link className="links-projects links">Projects</Link>
              <Link className="links-contact links">Contact</Link>
          </div>
      </div>
  );
};

export default Navbar;
